import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  const styles = {
    navbar: {
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center',
      backgroundColor: '#333',
      padding: '1rem',
      margin: '0px',
      height: '30px',
      boxShadow: '0 0 10px rgba(0, 0, 0, 0.1)',
      width: '1376px',
    },
    logo: {
      color: 'white',
      fontSize: '1.5rem',
      textDecoration: 'none',
    },
    navLinks: {
      display: 'flex',
      gap: '20px',
    },
    navLink: {
      color: 'white',
      textDecoration: 'none',
      fontSize: '1rem',
    },
  };

  return (
    <nav style={styles.navbar}>
      <div style={styles.logo}>Mantra Yoga</div>
      <div style={styles.navLinks}>
        <Link to="/" style={styles.navLink}>
          Home
        </Link>
        <Link to="/classes" style={styles.navLink}>
          Classes
        </Link>
        <Link to="/about" style={styles.navLink}>
          About Us
        </Link>
        {/* Add more links as needed */}
      </div>
    </nav>
  );
};

export default Navbar;
